C# Azure CosmosDb and Mongo - how to know if Find is hitting an index, and which are the best indexing recommendations for this scenario?<p>I have an ASP.Net Core 3.1 API that saves documents in Azure CosmosDb using Mongo Driver nuget package v2.11.</p>
<p>First of all, my document's class:</p>
<pre><code>public class Customer
{
   public Guid CustomerId {get;set;}

   public string Email {get;set;}

   public int Channel {get;set;}

   public string PartitionKey
   {
       get { return GetPartitionKey(CustomerId); }
       set {; }
   }

   public static string GetPartitionKey(Guid id)
   {
       return id.ToString().Substring(0, 2);
   }
}
</code></pre>
<p>Before sharing my repository class, I'd like to share a few details about the situations I'm struggling here. I have a partitioned collection (with the PartitionKey property of my Customer class) and I have two requirements for Find operations:</p>
<ul>
<li>To be able to find by CustomerId and Channel (same CustomerId can exist for different Channel)</li>
<li>To be able to check if user exists. The customer exists if the CustomerId or Email exist for the same Channel (again, same CustomerId or Email can exist for different Channel)</li>
</ul>
<p>My question is about the appropriate indexes, in order to take advantage of them when I find by another thing than the partition key. Let's move to the repository class, then to the indexes:</p>
<pre><code>public class MyRepository
{
    private IMongoCollection&lt;Customer&gt; Collection;

public MyRepository()
{
    MongoClientSettings settings = MongoClientSettings.FromUrl(new MongoUrl(&quot;The connection string&quot;));
    settings.SslSettings = new SslSettings() { EnabledSslProtocols = SslProtocols.Tls12 };

    var mongoClient = new MongoClient(settings);
    var database = mongoClient.GetDatabase(&quot;db-customer&quot;);

    this.Collection = database.GetCollection&lt;Customer&gt;(&quot;col-customer&quot;);

    //  What indexes here ?!?
}

public Customer GetByKey(Guid customerId, int channel)
{
    var channelFilter = Builders&lt;Customer&gt;.Filter.Eq(x =&gt; x.Channel, customer.Channel);

    var idFilter = Builders&lt;Customer&gt;.Filter.Eq(x =&gt; x.CustomerId, customer.CustomerId);

    var filter = channelFilter &amp; idFilter;

    Customer result = this.Collection.Find(filter).FirstOrDefault();

    return result;
}

public bool Exists(Customer customer)
{
    var channelFilter = Builders&lt;Customer&gt;.Filter.Eq(x =&gt; x.Channel, customer.Channel);
    var emailFilter = Builders&lt;Customer&gt;.Filter.Eq(x =&gt; x.Email, customer.Email);

    var idFilter = Builders&lt;Customer&gt;.Filter.Eq(x =&gt; x.CustomerId, customer.CustomerId);

    var filter = channelFilter &amp; (emailFilter | idFilter);

    bool found =  this.Collection.Find(filter).FirstOrDefault() != null;

    return found;
}
}
</code></pre>
<p>So, my question is, which is the best indexing setup for this repository? Should I create one index for each field I'm searching, like this:</p>
<pre><code>this.Collection.Indexes.CreateOne(new CreateIndexModel&lt;Customer&gt;(Builders&lt;Customer&gt;.IndexKeys.Ascending(i =&gt; i.CustomerId)));
    this.Collection.Indexes.CreateOne(new CreateIndexModel&lt;Customer&gt;(Builders&lt;Customer&gt;.IndexKeys.Ascending(i =&gt; i.Channel)));
    this.Collection.Indexes.CreateOne(new CreateIndexModel&lt;Customer&gt;(Builders&lt;Customer&gt;.IndexKeys.Ascending(i =&gt; i.Email)));
</code></pre>
<p>Or should I create compound indexes, depending on the searches I'm trying to attempt, like this?</p>
<pre><code>this.Collection.Indexes.CreateOne(new CreateIndexModel&lt;Customer&gt;(Builders&lt;Customer&gt;.IndexKeys.Ascending(i =&gt; i.CustomerId).Ascending(i =&gt; i.Channel)));
    this.Collection.Indexes.CreateOne(new CreateIndexModel&lt;Customer&gt;(Builders&lt;Customer&gt;.IndexKeys.Ascending(i =&gt; i.CustomerId).Ascending(i =&gt; i.Email).Ascending(i =&gt; i.Channel)));
</code></pre>
<p>By using Azure monitor checking metrics I always get low RU consumption and overall low response times, but my repository has a few records at this stage. I'm afraid as the number of records scale (this will have millions of records) that the RU consumption becomes too large or the response times too high, or in a worst case scenario, both.</p>
<p>Can I have your two cents on this subject?
Thanks.</p>

