Updating field in Array with MongoDB and NodeJS<p>I'm new to backend and trying to make a shopping cart with NodeJs and MongoDb.
I tried many thing but i can't update the quantity field of a product.</p>
<p>This is the schema</p>
<pre><code>const mongoose = require('mongoose');

const itemsSchema = mongoose.Schema(
  {
    prodId: String,
    name: String,
    price: Number,
    qty: {
      type: Number,
      default: 1,
      min: 1,
    },
  },
  {
    timestamps: true,
  }
);

const cartSchema = mongoose.Schema(
  {
    total: {
      type: Number,
    },
    products: [itemsSchema],
  },
  {
    timestamps: true,
  }
);

const Cart = mongoose.model('carts', cartSchema);

module.exports = Cart;
</code></pre>
<p>This is the controller</p>
<pre><code>const Cart = require('../models/cart');

exports.postItemToCart = async (req, res) =&gt; {
  const { prodId } = req.body;

  Cart.updateOne(
    { 'products.prodId': prodId },
    { $inc: { 'products.qty': 1 } }
  );

  return res.status(200).send(Cart);
};

</code></pre>
