<p>Here I defined <code>Content</code> schema -</p>
<pre><code>const ContentSchema = new Schema({
    .........
    linkName: {
        type: String,

    },
    description: {
        type: String,
    }
},
{
    timestamps: true 
});
module.exports = mongoose.model('Content', ContentSchema);
</code></pre>
<p>Comment schema <code>contentComment</code> -</p>
<pre><code>const contentCommentSchema = new Schema({
    ........
    content: {
        type: Schema.Types.ObjectId,
        ref: 'Content'
    }
},
{
    timestamps: true
});
module.exports = mongoose.model('contentComment', contentCommentSchema);
</code></pre>
<p>Here is the query where I am trying to list posts(<code>Content</code> schema) with corresponding comments from <code>contentComment</code> -</p>
<pre><code>const contentPromise = Content.aggregate([
    {
        $lookup: {
            from: 'contentComments',
            let: { contentId: '$_id' },
            pipeline: [{
                $match: {
                    $expr: {
                        $eq: [ '$content', '$$contentId' ]
                    }
                } 
            }],
            as: 'nbComments'
        }
        .......
    }
]);
</code></pre>
<p>Also I tried with following <code>$lookup</code> -</p>
<pre><code>const contentPromise = Content.aggregate([
    {
        $lookup: {
            from: &quot;contentComments&quot;,
            localField: &quot;_id&quot;,
            foreignField: &quot;content&quot;,
            as: &quot;nbComments&quot;
        }
        .......
    }
];
</code></pre>
<p>But every time it returns empty array for <code>comments</code>.</p>
<p>Here are two screenshots of <strong>MongoDB Compass</strong> for <code>contents</code> -</p>
<p><a href="https://i.stack.imgur.com/Wdzgm.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/Wdzgm.png" alt="content documents" /></a></p>
<p>and <code>contentComments</code> -</p>
<p><a href="https://i.stack.imgur.com/FlAvZ.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/FlAvZ.png" alt="content comments documents" /></a></p>
<p>I can't figure out the issue for returning empty error for <code>nbComments</code> even though there are sufficient comments for a specific post/content. Here is a screenshot -</p>
<p><a href="https://i.stack.imgur.com/Zwr0U.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/Zwr0U.png" alt="empty result for nbComments" /></a></p>

